import React, { useState } from 'react';
import { Link } from 'react-router-dom';
import '../global.css';

const navLinks = [
  { label: 'Pricing', href: '/pricing' },
  { label: 'Services', href: '/services' },
  { label: 'Search', href: '/search' },
];

const Navbar = () => {
  const [isDropdownOpen, setDropdownOpen] = useState(false);

  return (
    <nav
      style={{
        width: '100%',
        backdropFilter: 'blur(16px)',
        background: 'rgba(15, 15, 15, 0.4)',
        color: '#fff',
        display: 'flex',
        alignItems: 'center',
        justifyContent: 'space-between',
        padding: '0 2.5rem',
        height: '72px',
        position: 'fixed',
        top: 0,
        left: 0,
        zIndex: 1000,
        borderRadius: '0 0 1rem 1rem',
        borderBottom: '1px solid rgba(255,255,255,0.05)',
      }}
      className="poppins"
    >
      {/* Logo */}
      <div style={{ display: 'flex', alignItems: 'center', flex: 1 }}>
        <img
          src={require('../assets/logo.png')}
          alt="Logo"
          className="logo"
          style={{ width: 160, height: 160, marginRight: '1.2rem', objectFit: 'contain' }}
        />
      </div>

      {/* Centered Nav Links */}
      <div className="select">
  <div
    className="selected"
    data-default="Download"
    data-one="Windows"
    data-two="macOS"
    data-three="Linux"
  ></div>
  <div className="options">
    <div title="all">
      <input id="all" name="option" type="radio" defaultChecked />
      <label className="option" htmlFor="all" data-txt="Download"></label>
    </div>
    <div title="Windows">
      <input id="option-1" name="option" type="radio" />
      <label
        className="option"
        htmlFor="option-1"
        data-txt="Windows"
        onClick={() => window.location.href = '/windows'}
      ></label>
    </div>
    <div title="macOS">
      <input id="option-2" name="option" type="radio" />
      <label
        className="option"
        htmlFor="option-2"
        data-txt="macOS"
        onClick={() => window.location.href = '/macos'}
      ></label>
    </div>
    <div title="Linux">
      <input id="option-3" name="option" type="radio" />
      <label
        className="option"
        htmlFor="option-3"
        data-txt="Linux"
        onClick={() => window.location.href = '/linux'}
      ></label>
    </div>
  </div>
</div>


      {/* Login Button */}
      <div style={{ flex: 1, display: 'flex', justifyContent: 'center', paddingRight: '1rem' }}>
        <Link
          to="/login"
          className="poppins login-popout"
          style={{
            background: 'linear-gradient(135deg, #4DFF29, #9FFF62)',
            color: '#181818',
            fontWeight: 700,
            fontSize: '1.1rem',
            border: 'none',
            borderRadius: '0.5rem',
            padding: '0.75rem 2rem',
            cursor: 'pointer',
            textDecoration: 'none',
            transition: 'transform 0.2s ease, box-shadow 0.2s ease',
          }}
        >
          Login
        </Link>
      </div>

      {/* Styles */}
      <style>{`
        .nav-underline {
          display: inline-block;
          position: relative;
        }

        .nav-underline::after {
          content: '';
          position: absolute;
          width: 0%;
          height: 3px;
          bottom: -4px;
          left: 0;
          background-color: #4DFF29;
          transition: width 0.3s ease;
        }

        .nav-underline:hover::after {
          width: 100%;
        }

        .nav-underline:hover {
          color: #4DFF29;
        }

        .login-popout:hover {
          transform: translateY(-2px);
          box-shadow: 0 4px 20px rgba(77, 255, 41, 0.35);
        }

        .dropdown-item:hover {
          background-color: #222;
        }
      `}</style>
    </nav>
  );
};

export default Navbar;
